import React from "react";
import Header from "./Components/Header/Header";
import "./App.css";
import WhiteWave from "./Components/White Wave/WhiteWave";
import About from "./Components/About/About";

const App = () => {
  return (
    <div>
      <Header />
      <WhiteWave />
      <About />
    </div>
  );
};

export default App;
